objet:
d'informer, d'éduquer, de sensibiliser le tout public et plus particulièrement les scolaires à tout ce qui concerne l'environnement, le développement durable avec la promotion d'un patrimoine naturel et culturel ; en priorité dans bastia, son département, l'île de corse et l'espace méditerranéen ;de privilégier les initiatives à l'environnement, au développement durable par l'organisation et l'animation de classes vertes, classes de mer, classes de découvertes
de favoriser la diffusion de la culture scientifique et technique dans nos domaines de compétences, de répondre à des appels à projets concernant nos domaines de compétences, de chercher à réaliser tous supports et outils pédagogiques : brochures, films, vidéo, cahiers techniques, kakemono, mallettes, pour enrichir et gérer un centre de documentation et de ressource pédagogiques ; d'aider à la création d'équipements structurants (marinarium, chemin de mer et du littoral, écoquartier, jardin pédagogique) 	de favoriser toutes les activités liées à l'environnement, et au développement durable par la recherche, l'éducation, la créativité, la formation, l'animation, l'organisation de séminaires, forum, assises
d'aider à enrichir la connaissance, la protection des ressources naturelles et culturelles pour aider au développement d'activités économiques de qualité pour un développement durable : croissance bleue, croissance verte ; d'impulser et d'accompagner de nouveaux comportements pour développer une véritable citoyenneté de l'environnement (approche éco citoyenne, observatoires participatifs et collaboratifs)de faciliter tout contact avec des structures semblables ou complémentaires en priorité sur notre territoire ayant des objectifs communs ;de faciliter l'appartenance à des réseaux locaux ou étrangers pour une communication et un enrichissement partagé ;de privilégier plus spécifiquement tout ce qui concerne l'écologie marine côtière avec deux stratégies précises pour que les corses s'approprient leur insularité (1000km de côtes) et leur appartenance à la méditerranée (patrimoine naturel et culturel) ;

pratique de la natation , son organisation et son développement ainsi que la pratique et l'organisation d'activités sportives, ludiques et éducatives entrant dans le cadre du sport pour tous ; 
- sports de glisse urbaine : roller, skate, trottinette
- sports de pleine nature : VTT, kayak de mer, course d'orientation, kermesse sportive ; l'organisation d'épreuves de compétitions, de natation et de nage en eau libre ; l'organisation de stages d'activités de pleine nature ; l'organisation de journées omnisports de découvertes d'activités sportives à l'attention des enfants et des adultes ; l'organisation de randonnées par le biais du roller ; du skate et de la trottinette ; le développement et le maintien des capacités physiques de ses adhérents

l'association a pour objet de susciter et de coordonner des actions concertées dans le domaine de l'insertion professionnelle et du développement local sur la région Corse ; 
l'association favorisera la mise en cohérence des projets locaux avec l'ensemble des politiques publiques dans le domaine du développement local et de l'insertion professionnelle ; l'action de l'association s'inscrira dans une démarche prospective par l'évaluation des besoins sur site, lélaboration de programme d'action et l'évaluation des mesures mises en uvre ; l'association ADAL 2B met en place des ACI (atelier chantier dinsertion) qui ont pour mission d'assurer l'accueil, l'embauche et la mise au travail sur des actions collectives des personnes sans emploi rencontrant des difficultés sociales et professionnelles particulières ; 
a ce titre, ADAL 2B organise le suivi, l'accompagnement, lencadrement technique et la formation de ses salariés en vue de faciliter leur insertion sociale et de rechercher les conditions d'une insertion professionnelle durable

sensibiliser les usagers de la route à la vulnérabilité des cyclistes empruntant la chaussée ; 
inciter les pouvoirs publics à aménager les bas-côtés des axes principaux pour assurer une plus grande sécurité aux cyclistes ;
initier le tout public à la maîtrise et aux déplacements à vélo avec rappel aux bons comportements routiers et au code de la route ;
initier le tout public au bon entretien d'un vélo afin de rouler en sécurité ; défendre les intérêts matériels et moraux des familles ;
sensibiliser le tout public aux conséquences d'accidents routiers ;
formation continue d'adulte, enseigner la conduite à vélo et éduquer à la sécurité routière, et plus généralement toutes actions de formation et de perfectionnement de la conduite de tous véhicules à destination des particuliers et des professionnels

cette association a pour but de faire partager la passion pour le kitesurf au travers d'échanges sur idées et des informations sur ce sport de glisse ; il a aussi pour but d'organiser des évènements sportifs liés au kite (journée cerf volant, course de kite, etc 
) ainsi que de participer à des manifestations culturelles et sportive telle que la journée du vent à ile rousse ; il doit promouvoir aussi ce sport par des démonstrations, des expositions, reportages photographiques, textes et films, foires aux échanges, achats et ventes de matériel par l'association, créer des moments conviviaux (repas, animations
)

il s'agit d'une association gestionnaire de plusieurs établissements ou dispositifs : médicaux sociaux : centre de préorientation, unité d'évaluation de réentrainement et d'orientation social et professionnelle UEROS, centre de rééducation professionnelle CRP et tout autre établissement de même type ; groupes d'entraide mutuelle instituts de formation sanitaire et social ; centres de formation professionnelle continue et initiale centre de formation des apprentis CFA ; 
lassociation se propose en particulier ; de mettre uvre des actions dinsertion et de formation notamment par l'apprentissage pour les collectivités locales, les services de lÉtat, les associations, les établissements et les entreprises, ainsi que pour les personnes handicapés, les demandeurs d'emplois, les salariés, les chefs d'établissements et d'entreprises
d'organiser des actions d'accueil, de bilans,d'orientation, de formation, d'accompagnement et de suivi de publics en difficultés d'insertion et ou en reconversion professionnelle ; de mettre en place et de gérer des centres de ressources thématiques ; d'organiser des actions d'information, de formation, de recherche dans le domaine sanitaire, sociale et médico-social ; de réaliser des études, mener des actions de recherche et d'expérimentation, organiser des journées d'études séminaires et universités en lien avec l'objet de l'association ; ainsi que toutes activités annexes, connexes ou complémentaires se rattachant directement ou indirectement à l'objet

proposer des espaces de médiation dans les musiques actuelles et traditionnelles ; 
proposer des évènements dans les domaines du spectacle vivant, la musique, les sciences de la vie et de la terre, de l'environnement et l'agriculture; fonction d'aide à la production, à la création et à la diffusion musicale, fonction de label musical ; 
créer des espaces de résidences pour les artistes et artisans de domaines variés; 
promouvoir et communiquer sur ces espaces et les artistes pris en charge par l'association; 
organiser  divers évènements et un festival mettant en avant les productions  de l'association et la localité, 
créer des ateliers divers permettant la médiation musicale, scientifique, culturelle et scientifique liés à l'association; 
permettre à différents groupes, et artistes et intervenants de se produire et d'intervenir dans différents lieux du domaine privé ou public
fonction d'activité économique d'aide au financement de matériel ou prestations de services pour les différents artistes liés à l'association

de créer le lien entre les parents d'élèves ; 
de respecter les fondamentaux de l'école ,  laïcité, neutralité ; de rechercher et débattre en commun sur les sujets concernant l'intérêt des élèves, sur le plan intellectuel, éducatif, culturel et matériel ; 
de contribuer à l'ensemble des projets de l'école et d'apporter une aide supplémentaire ; 
de proposer des actions, extra-scolaire et peri-scolaire permettant l'épanouissement des élèves ; 
d'établir une collaboration avec l'ensemble des acteurs (école, ALSH, CLAE, commune, organismes ;
d'organiser et d'animer des activités, événements, manifestations; de travailler en collaboration avec l'équipe pédagogique et proposer une aide, une dynamique, des idées
Cette association se veut être un partenaire des établissements scolaires élémentaire et maternelle implantés sur la commune de Folelli ainsi que le collège Henri Tomasi de la Casinca implanté sur la commune de Folelli

participer à l'éducation populaire notamment dans les domaines de l'écologie, de l'autonomie, de la politique, de la philosophie, de l'économie, des sciences sociales et environnementales ; Promouvoir la défense et la préservation de l'environnement naturel ; Conduire, initier, participer à toutes actions, quelle que soit leur nature, favorisant l'objet de l'association ; 
Dans ce but, elle pourra entreprendre : Le partage d'informations et de connaissances sous diverses formes, que ce soit par la réalisation et la diffusion d'articles web, de vidéos, ou tout autre format numérique ; L'édition de livres, de documentaires, ou d'autres documents sur quelque support que ce soit ; L'organisation de conférences, d'activités de mise en valeur du patrimoine naturel et culturel, et d'ateliers de partage de savoirs et de pratiques durables et autonomisantes ; 
Cette association est à but non lucratif, au service de l'intérêt général et environnemental ;

développer la pratique de la pétanque et du jeu provençal, 
faciliter la formation d'arbitres et d'éducateurs, 
favoriser la création d'une école de Pétanque ;

promouvoir l'équitation western en France et plus particulièrement le Barrel Racing et le Pole Binding, disciplines équestres de vitesse ; 
Développer la relation homme-cheval nécessaire entre les deux lors des épreuves ; 
Participation à de nombreuses manifestations et compétitions en France et au niveau international ;

favoriser, soutenir et développer des activités d'intérêt général ayant pour finalité de favoriser l'accès, la prévention et la promotion à la santé « pour tous » ou de promouvoir des actions sanitaires et sociales ; 
Dans ce cadre, le fonds a pour ambition tant d'assurer le financement des activités précitées que de permettre la constitution et la gestion de fonds dédiés au financement d'activités de même nature ; 
Il pourra également recevoir des versements pour le compte d'uvres ou d'organismes mentionnés aux articles 200 et 238 bis du Code général des impôts qui s'assignent un but analogue au sien ;

améliorer le sort des animaux, leur porter assistance, les défendre et les protéger : 
Prendre en charge des animaux trouvés, abandonnés, maltraiter, les accueillir au sein de familles d'accueil ou de refuges, prodiguer les soins d'urgence, les faire adopter ; 
Organiser des manifestations en rapport avec le but de l'association ; 
Organiser et gérer un ou des refuges créés par l'association et/ou sous convention ;

recueillir des fonds nécessaires à la participation de différentes courses et toutes manifestations du sport automobile ; 
Organiser toutes manifestations nécessaires dans le but de recueillir ces fonds ; 
Organiser toutes opérations de communication dans le but de recueillir ces fonds ; 
Organiser toutes autres opérations non limitatives pour atteindre le but précisé précédemment ;

cette association a pour objets : 
o	De créer des liens entre les habitants du quartier par des animations variées ponctuelles et tout au long de l'année, tout en préservant la mixité du quartier et les échanges entre les générations et les différentes cultures ; 
o	D'améliorer le cadre de vie en accompagnant des projets portés par les habitants du quartier, en mettant en place un partenariat avec les institutions de proximité ; 
o	D'inciter à la pratique du sport ( foot, gymnastique
) , à son utilisation comme outil de prévention contre toutes formes de discrimination, tout en respectant les règles d'hygiène, de sécurité et de déontologie sportive ; 
o	D'associer l'accompagnement scolaire, l'ouverture culturelle et la pratique d'un sport pour prévenir l'échec scolaire et l'exclusion ; 
o	D'amener à la responsabilité, au civisme, à l'autonomie et à la solidarité à travers toute activité dans le cadre d'un fonctionnement démocratique et laïque
o	De pratiquer des activités économiques comme définies à l'article L442-7 du code du commerce afin de réaliser l'objet de l'association ; 
Et toutes activités connexes ou complémentaires se rapportant directement ou indirectement à l'objet social

cette association a pour objet  : 
promouvoir, développer, participer, organiser des événements sportifs automobiles : rallye, raid, rallye raid, concentration de véhicules, salon de véhicules autour du sport automobile ; 
contribuer au financement de la pratique du sport automobile en compétition par : des dons, subventions, sponsors, mécénat ; 
pour la réalisation de son objet, l'association a pour moyen d'action de mettre en place une structure de réparation, préparation, d'assistance en rallye, raid et rallye raid, la vente permanente ou occasionnelle de tous produits ou service entrant dans le cadre de son objet susceptible de contribuer à sa réalisation ; 
les publications, les conférences, les réunions de travail ;

participer à différents rallyes ; 
entretenir, réparer des véhicules de compétition ; 
contribuer à la bonne organisation financière de projets ;

cette association a pour objet la sauvegarde, la promotion du patrimoine matériel et immatériel de la commune de Volpajola et de la tradition orale, l'organisation d'événements culturels (concert, conférence
) ; L'association aura aussi la tâche de venir en aide aux plus nécessiteux (personnes âgés, malades
) ; 
Elle a pour but aussi d'initier les personnes au chant polyphonique, afin de perpétuer et de promouvoir la tradition orale ;

sensibiliser à l'écologie, dans le domaine du bien-être et de l'alimentation ; 
faire en sorte que chacun renoue avec la nature qui l'entoure et se sente apaisé et à l'aise dans sa vie ; 
conduire, initier, participer à toutes actions favorisant l'objet de l'association ; dans ce but sera réalisé un 'Salon Tendance Bio' ;

cette association a pour objet : 
-	intervention en cas de risques courant pour aider les sinistrés (incendie, mouvement de terrains
) , 
-	mobilisation en cas d'alerte météo ; 
-	intervention dans le cadre du Plan communal de sauvegarde pour porter assistance à la population (accueil des sinistrés, hébergement d'urgence, aide au retour à la normale
) ; 
-	information et préparation de la population (alerte, conduite à tenir face à un risque, points de regroupement) ; 
-	intervention dans les établissements scolaires pour sensibiliser les élèves aux risques majeurs ; 
-	information de la population sur les risques majeurs (réunions publiques, journées thématiques, expositions
)

la pratique de la langue corse et la conservation des us et coutumes « nustrale» ; 
le perfectionnement culturel, intellectuel et moral de ses membres par l'étude de la philosophie et des valeurs morales et sociales ; pratique de la solidarité, recherche de la vérité, perfectionnement intellectuel et social de l'humanité ; mise en valeur et défense de la laïcité ; administration et gestion ;
la prise à bail de tous locaux et l'acquisition d'un local, nécessaire à l'objet social ;

cours d'initiation de tango et d'évolution à partir de 5 ans ;
démonstration en tout genre ;
évènements variés en relation avec les buts de l'association (chaussures, vêtements, accessoires, etc) ;
participation et/ou création d'animations diverses

inventorier, conserver, valoriser et transmettre les savoirs et usages traditionnels de Corse concernant la musique ; 
permettre, faciliter et développer l'accès, l'étude, le partage et la transmission de toute connaissance concernant la musique en Corse ; 
révéler et promouvoir les auteurs, compositeurs et interprètes en Corse ; 
exploiter les activités liées à la création, la production, la diffusion, l'organisation, la gestion, le développement et la promotion de tous spectacles et événements culturels et artistiques, notamment musicaux

mouvement politique concourant au débat public et à l'expression du suffrage universel ; 
rassembler les citoyens qui se reconnaissent dans les valeurs et objectifs de la gauche humaniste attachée à la démocratie, la solidarité, et la justice sociale ; 
contribuer à l'essor économique, social et culturel de la Corse, à la préservation de son environnement et de ses atouts spécifiques, notamment sa langue, dans le cadre de la République une et indivisible qui lui reconnait un statut de décentralisation avancée ;

promouvoir la restauration de la chapelle St Jacques (Cannelle) ;
valorisation et défense du patrimoine culturel et architectural du hameau de Cannelle ;
organisation ou participation à des manifestations, en accord avec ces objectifs ;
entreprendre, sur accord unanime du bureau, certains travaux urgents

promouvoir, soutenir, et valoriser la recherche et particulièrement la recherche en gériatrie et en gérontologie (mise en place d'études cliniques ou fondamentales, de recherches-action) , la formation continue en médecine gériatrique et en gérontologie des praticiens hospitaliers, et du personnel soignant paramédical en exercice ou à la retraite ; 
réaliser l'information du grand public dans le domaine du vieillissement et du bien-vieillir ;
promouvoir par tout moyen l'enseignement post-universitaire et les travaux scientifiques de ses membres ; 
développer des actions de prévention sous toutes ses formes, dans le domaine du bien-vieillir

l'objet de l'association « AVA SPIRITU » est de favoriser, développer, promouvoir toute activité culturelle ou artistique et l'éducation artistique musicale et théâtrale ; 
l'exploitation de toute les activités liées à la création, la production, l'organisation, la gestion, le développement et la promotion de tous spectacle et événement culturels et artistiques, notamment musicaux ; tant en France qu'à l'étranger ; pour tous publics ; 
au moyen de tous les supports de communication et d'édition, de toutes les techniques et technologies, des moyens humain et structurels que l'association juge pertinent d'utiliser pour servir ses missions ;

promouvoir la littérature et la culture franco-corse ; 
Organiser des événements culturels et littéraires au sein de la ville universitaire de Corte ; 
Organiser des voyages pédagogiques ;

concourir à l'éducation du citoyen plus particulièrement ;
organiser et développer la pratique du canoë-kayak et des disciplines associées, agréées par la fédération Française de canoë-kayak ;
accueillir des personnes handicapées pour les accompagner dans la pratique du canoë-kayak et des disciplines associées ; 
de concourir au développement d'autres activités sportives aquatiques et touristiques d'itinérance, de randonnée, de pleine nature pour des raisons de complément et d'équilibre aux pratiques nautiques ;
uvrer à la connaissance, à la protection, à la mise en valeur de l'environnement naturel, notamment aquatique nécessaire à ces pratiques ;
d'organiser des échanges avec d'autres clubs

aider la famille de Nicolas, atteint d'une tumeur cérébrale à supporter ce drame sans cumuler des problèmes d'argent ; 
aider d'autres familles si cela est possible ;
permettre à des familles subissant le même drame (cancer chez un enfant) à se retrouver, s'épauler, se soutenir ; 
être disponible, à l'écoute, essayer d'anticiper les soucis que génèrent ces drames dans les familles pour leur éviter d'avoir à gérer par la suite un cumul de soucis (notamment financier, mais aussi garde d'enfant, et autres problèmes occasionnés par ce chamboulement) ;
pouvoir se rapprocher des autres associations pour approfondir mon aide et diriger les personnes en difficultés ;

l'association dite, «in team'a » a pour but de produire des d'artistes locaux et internationaux en
proposant des concerts filmés en présence d'un public en petit comité, équipé de casques audio , 
dans des lieux plus ou moins insolites , décorés à chaque tournage par un créateur insulaire ; 
Chaque personne du public dispose d'un réglage de volume individuel pour profiter pleinement de
lexpérience sonore ; 
Cette association a pour but de promouvoir les artistes insulaires , et d'organiser des rencontres
musicales de tout style , afin de créer des mélanges étonnants ; L'association basée actuellement sur
Bastia, peut élargir ses champs territoriaux sur le plan national voire international ; 
Elle pourra également mener toute action d'embauche et formation en relation avec son objet ;

d'impliquer les jeunes (16-29 ans) dans la vie de la commune de 3 manières : 
- Rassembler les jeunes de Borgo autour d'une structure identifiée ; 
- Participer aux événements déjà existant en proposant une aide bénévole ; 
- Créer des nouveaux événements autour des thématiques sociales, environnementales, citoyennes et solidaires ;

sous l'égide de lÉglise de Corse, cette association a pour but : 
-	De permettre aux confréries de Corse de partager, de mettre en commun leurs pratiques, leurs coutumes, leurs offices, leurs actions, qu'elles soient opératives, caritatives, culturelles, cultuelles ou cantonales ; 
-	De créer un lieu de convergences et de mise en place de projets communs ; 
-	De donner aux Confréries « rurales » un lieu de rencontre et de travail ; 
-	De générer un lieu de prière et de réflexion sur les problèmes de notre société à la lumière de lÉvangile ;

partager, exprimer et effectuer notre passion du sport automobile ; 
- acquérir des sponsors et réaliser des partenariats avec diverses entreprises ; 
- gérer la promotion de nos sponsors et partenaires ; 
- rassembler et gérer les budgets nécessaires à la réalisation de notre passion ;

la défense des intérêts des commerçants ;
favoriser et promouvoir les activités économiques de l'association principalement l'industrie, le commerce, par le biais d'organisation de manifestations diverses, fêtes, foires, expositions, salon ou tout rassemblement dans le cadre de la loi, spectacles, animations, seule ou en liaison avec d'autres organisations locales, régionales ou nationales
organiser la formation des membres de celle-ci par le biais de réunions, débats, séminaires ;

cette association a une vocation culturelle dans le domaine du  bâti ancien et de sa réhabilitation  tels que : ruines, vieux fours à pain, étables, ecuries, soues, appentis,  abris   
 ; ; , L'acquisition de ce type de biens ainsi que de manière exceptionnelle et sous autorisation préalable, possibilité d'offrir des produits à la vente, ou fournir des services ; 
L'association contribue donc à la mise en valeur de toutes les formes de patrimoine, bâti ou non du rural, grand ou petit patrimoine, et sensibilise le public à l'intérêt d'assurer la préservation de cette mémoire collective ; 
L'association ainsi créée  se veut être une réponse originale concernant la préservation du patrimoine bâti en milieu rural, pour le Département de la Haute Corse et notamment  le territoire de l'ancien Canton de l'Altu di Casacconi ;

l'objet de l'association consiste à organiser et participer à des événements sportifs (Raid 4L Trophy ) , et culturels comportant au moins un volet humanitaire
Aux fins de réalisation dudit objet, l'association utilisera les moyens d'action suivants : 
L'organisation de manifestations et toute initiative pouvant aider à la réalisation de l'objet de l'association ; 
La vente permanente ou occasionnelle de tous produits ou services entrant dans le cadre de son objet ou susceptible de contribuer à sa réalisation ; 
L'association s'interdit toute discrimination, veille au respect de ce principe et garantit la liberté de conscience pour chacun de ses membres ;

sensibiliser et informer des usagers de la mer aux bonnes pratiques de préservation de la qualité des eaux marines, de la faune et de la flore ; 
Organiser de journées sensibilisation et actions de dépollution des criques et plages sur le parcours du Parc Marin du Cap Corse ; 
Informer des Pecheurs de loisirs, plaisanciers et usagers de la mer sur les pratiques éco responsables ; 
Etre la courroie de transmission entre les différents acteurs officiants dans leurs domaines d'activité respectives sur le pourtour du Cap Corse ( base de kayak, club de voile, club de plongée, loueurs de paddle, loueurs de bateaux, pêcheurs de loisirs et pêcheurs sous-marin) ; 
Sensibiliser notre jeunesse aux bons usages et pratiques éco responsables, implication sur diverses actions dépollution sortie éducative en lien avec les écoles ; 
Organiser des manifestations afin d' obtenir des soutiens ou des dons organisation de chantiers bénévoles inter génération ;

découvrir le patrimoine culturel et naturel des sentiers de Corse ; 
sorties champêtres avec séances photos (concours photos) faune & flore ; repérer les anciennes bergeries, constructions, chapelles et retracer nos passages originels ; 
entretien des chemins, traçage, débroussaillage et balisage naturels de ceux-ci

organiser des événements diffusant des idées et inspirations, sur des thématiques diverses telles que l'audace, l'innovation, le sport, les arts, la science, léconomie, la technologie, les sciences humaines, la culture, etc ;) , pouvant se rattacher directement ou indirectement à l'objet social et susceptibles d'en faciliter l'extension ou le développement ; 
mettre en avant des intervenants, adultes et enfants, qui ont une conviction commune "pour moi aussi c'est possible" ; 
montrer qu'entreprendre sa vie est accessible à tous, à travers ces événements donnés en français et corse ; 
développer la confiance en soi des le plus jeune âge, partager les passions, expériences et rêves de chacun en devenant conférencier ;
donner une voix aux enfants en favorisant l'ouverture et les échanges à l'international ;
exercer toutes les activités et accomplir toutes les opérations tendant à réaliser cet objectif, en France et à l'étranger ;

lutter contre toutes discriminations annihilant l'accès aux droits économiques, sociaux, sportifs et culturels des citoyens ; 
-favoriser, développer et promouvoir l'inclusion sociale des personnes contraintes et / ou vulnérables ; 
-Promouvoir l'éco citoyenneté ;

promouvoir et mettre en uvre toutes activités socio-culturelles favorisant les échanges entre la Corse et la Nouvelle-Calédonie ; veiller à la mise en valeur de ces échanges ; 
