la création, sous le signe de Saint-Lazare de Jérusalem, d'un vaste rassemblement fraternel, spirituel et temporel, de tous ceux qui désiraient contribuer à l'application des principes de l'église catholique dans la vie privée, sociale, publique et internationale, et dans un esprit d'entraide et de miséricorde ; pour ce faire, les membres de l'association, par l'exercice public du culte, de la bienfaisance, de la charité, des groupes de prières, approfondissement de la foi chrétienne, organisation de conférences, réunions et manifestations, oeuvres de bienfaisance ont soin de perpétuer les usages de l'ancienne Chevalerie ; maintenir, encourager, soutenir et développer les oeuvres hospitalières en faveur des malades, des infirmes, des lépreux et de ceux qui sont dans le besoin dans l'esprit et le respect des traditions et de l'idéal spirituel et moral de la chevalerie de saint Lazare de Jérusalem ; le respect des vertus théologales demeure pour chaque membre un souci constant ; les actions caritatives se pratiquent à titre personnel dans des structures juridiques indépendantes adéquates ; 
« ARCHICUNFRATERNITA DI SAN LAZARU DI CUVENTU D'ALISGIANI » est l'héritière, de l'Ordre (Militaire et  Hospitalier) de Saint Lazare de Jérusalem, des Confréries des Frères Pénitents de Saint Lazare  ; dont les Blancs (Marseille, La Major et Château-Gombert) des Gardiens des Reliques de Saint Lazare ; Saint Lazare est leur Saint Patron et Protecteur ; 
L'Archicunfraternita di San Lazaru di Cunventu d'Alisgiani, est fondée en  mémoire de Père Olive TAGLIAZUCCHI ;

